INSERT INTO `angebot` (`AngebotID`, `MarkeID`, `ModellID`, `UserID`, `Neu`, `Motorrad`, `NichtSichtbar`, `EZMonat`, `EZJahr`, `Preis`, `KM`, `Kraftstoff`, `Hubraum`, `PS`, `AnzTuere`, `Farbe`, `Metallic`, `Sitz`, `Schadstoffklasse`, `Ausstattung`, `TUEV`, `TUEVDate`, `Einstelldatum`, `Beschreibung`) VALUES
(1, 6, 3, 7, 0, 0, 0, 5, 2001, 1500, 162300, 'Benzin', 1589, 155, '2/3', 'Schwarz', 0, 5, 'Euro 3', '1.6 Twin Spark 16 V Klimaanlage ', 1, '8/2016', '2015-02-16', 'Verkaufe meinen Alfa wegen Familien zuwachs, Fahrzeug hat Klimmanlage, Zv, Zahnriemenwechsel bei 100,00 Kilometer gewechselt , Servolenkung, Elektrische Fensterheber rechts und links, Optimales Stadt Auto, Fahrzeug ist angemeldet und wird täglich gefahren, wird abgemeldet Verkauft, Verkauf von Privat ohne Garantie'),
(5, 11, 26, 7, 0, 0, 0, 8, 1998, 2800, 240000, 'Benzin', 1000, 136, '4/5', '', 0, 0, '', '', 0, '', '2015-02-16', ''),
(6, 6, 24, 7, 0, 0, 0, 2, 2007, 12899, 45235, 'Benzin', 2198, 185, '2/3', '', 0, 0, '', '', 1, '4/2016', '2015-02-17', ''),
(10, 11, 35, 8, 0, 0, 0, 3, 2009, 11450, 233400, 'Diesel', 2698, 190, '2/3', 'Weiß', 0, 4, 'Euro 5', 'Coupe 2.7 TDI Autom. Leder, Navi, Sportsitze ', 0, '', '2015-02-18', 'Audi A5 2,7 TDI\r\n\r\n    1 Hand\r\n    Scheckheft\r\n    19 Zoll Alufelgen\r\n    Getriebe muss überholt werden!!\r\n    verkauf an Gewerbetreibende bevorzugt\r\n\r\n\r\n\r\nSonderausstattung:\r\nAußenspiegel elektr. verstell-, heiz- und anklappbar, Durchladeeinrichtung mit Skisack, Einparkhilfe hinten (APS), Fahrer-Informations-System (FIS) mit Farbdisplay, Innenausstattung: Dekoreinlagen Aluminium Hologramm, Lenkrad (Sport/Leder - 3-Speichen) mit Multifunktion, Licht- und Regensensor, LM-Felgen 8,5x19 (5-Arm, Y-Design), Multi-Media-Interface MMI Navigation Plus, Reserverad als Notrad, Sport-Fahrwerk, Sportsitze vorn, Vorrüstung Mobiltelefon/Handy mit Bluetooth-Schnittstelle, in Mittelarmlehne integriert, Xenon-Scheinwerfer Plus adaptive light (Abbiegelicht integriert)\r\n'),
(11, 6, 15, 8, 0, 0, 0, 3, 1980, 3000, 82000, 'Benzin', 500, 131, '4/5', 'Beige', 0, 5, 'keine', '2.0 L ', 0, '', '2015-02-18', ''),
(12, 6, 25, 8, 0, 0, 0, 5, 1965, 24900, 95000, 'Benzin', 2600, 145, '2/3', 'Silber', 1, 4, 'keine', 'Coupe 2600, silber / Leder braun', 0, '', '2015-02-19', 'Alfa Romeo 2600 Coupe Sprint\r\ntechnisch in gutem Zustand , Motor und Getriebe funktionieren\r\nsehr gut\r\noptische MÃ¤ngel ( nicht gravierend )\r\nInnenausstattung muss aufgefrischt werden\r\nBilder sind Oirignalbilder\r\nFahrzeug im Vorlauf'),
(13, 11, 64, 8, 0, 0, 0, 11, 1992, 3700, 242000, 'Benzin', 4172, 280, '2/3', 'Schwarz', 1, 5, 'Euro 2', 'exklusiv', 1, '1/2016', '2015-02-19', ' AUDI V8 - 4,2 QUATTRO EXCLUSIVVOLLAUSTATTUNG,LEDER SCHWARZ MIT MEMORY,3xROLLO,KLIMAAUTOMATIK\r\nFUNKTIONIERT,AUTOMATIK,KLEINE INSPEKTION,NEU TÃ?V -1/16,8 FACH BEREIFT,\r\nAUDI RS FELGEN in 18 ZOLL+ERSATZRAD,\r\nWINTER 225er + SOMMER 255er,\r\nGEBRAUCHSSPUREN-22 JAHRE ALT '),
(14, 3, 11, 8, 0, 1, 0, 1, 1954, 3500, 2500, 'Benzin', 0, 11, '2/3', 'Schwarz', 0, 0, 'keine', '', 0, '', '2015-02-19', ' Bei diesem Motorrad Oldtimer können einige Angaben nur geschätzt werden....\r\nDas Bj 1954 ist geschätzt aufgrund des Briefeintrages, der km-Stand ist gemäß Tacho-Angabe, aber ob dieser tatsächlich korrekt ist...?\r\nDas Motorrad stand nun einige Jahre als Ausstellungsstück im Innenbereich, war bis dahin aber fahrbar.\r\nBei Interesse einfach melden...  '),
(15, 11, 52, 8, 0, 0, 0, 2, 2014, 99800, 22900, 'Benzin', 3993, 560, '4/5', 'Weiß', 0, 4, 'Euro 5', '*Vollausstattung***21 Zoll***Keramik*', 1, '2/2017', '2015-02-20', 'Audi RS 7\r\n\r\nDer Sportler unter den Limousinen. EIn GranTurismo mit Renngenen.\r\n\r\nZur Ausstattung dieses tollen Fahrzeugs gehören unter anderem:\r\n\r\n- Front und Rückfahrkamera\r\n\r\n- Head up Display\r\n\r\n- Leder Valcona mit Wabensteppung und RS Prägung\r\n\r\n- Komfortpaket\r\n\r\n- Dynamikpaket Plus\r\n\r\n- Assistenzpaket inkl. Audi pre sense plus\r\n\r\n- Scheiben abgedunkelt\r\n\r\n- Optikpaket Carbon inclusive Lufteinlasstrichter mit beleuchtetem quattro Schriftzug\r\n\r\n- Alu Räder 9x21 mit Reifen 275/30 R21\r\n\r\n- Kamerabasierte Tempolimitanzeige\r\n\r\n- Home Link\r\n\r\n- RS Sportabgasanlage\r\n\r\n- Schiebedach\r\n\r\n- Komfortschlüssel\r\n\r\n- Außenspiegelgehäuse in Carbon\r\n\r\n- Audi connect inklusive Autotelefon\r\n\r\nGerne sinbd wir Ihnen bei einem Leasing/ Finanzierung oder Export in das Ausland behilflich\r\n\r\nWeitere einzigartige Fahrzeuge finden Sie unter\r\n\r\n    www.vos-cars.com*\r\n\r\n\r\nIrrtümer und Änderungen vorbehalten\r\n'),
(16, 11, 38, 8, 0, 0, 0, 1, 2011, 23000, 80000, 'Benzin', 2967, 245, '4/5', 'Schwarz', 0, 5, 'Euro 5', 'SPB 3.0 V6 quattro S tronic', 0, '', '2015-02-20', 'AUDI A7 3.0 tdi quattro 245cv DA VETRINA KM originali e certificati AUDI full full optional Bollo Pagato. NO SUPERBOLLO. '),
(17, 11, 61, 10, 1, 0, 0, 0, 0, 133950, 0, 'Benzin', 3993, 519, '4/5', 'Grau', 1, 4, 'Euro 6', 'Standheizung, Massagesitze, Keramikbremse', 0, '', '2015-02-24', 'Effizienzklasse: E, Unverbindliche Preisempfehlung des Neufahrzeuges: 153.655 EURO!\r\nCO2-Effizenzklasse: E (EnVKV-Label siehe bei den Bildern)\r\nStandheizung, Massagesitze, Keramikbremse, LED- Hauptscheinwerfer, Alcantara-Paket mit schwarzem Dachhimmel, Formhimmel Alcantara, Mit Nachtsichtsystem, Mit Front und Rückfahrkamerasystem und zwei Seitenkameras, Standheizung mit Funkfernbedienung, Sitzeinstellung,elektrisch für beide Vordersitze mit Memory, Digitaler Radioempfang, Navigationssystem (MID), Schiebe-/Ausstelldach, Solar, elektrischmit Vorwahlautomatik, Mittelarmlehne vorn, DVD-Wechsler, Sitzbezug in Leder ""Naturleder"", Keramikbremse, Leichtmetallräder 9J x 20, Ledervariante 2, Tür-Zuziehhilfe, Dekor-Einlagen, Carbongewebe, Dekorleisten Aluminium, Sitzbelüftung/Massagesitz(e)vorn, 4 Corner Luftfederung mit elektronisch geregelter Dämpfung, Garagentoröffner, Zentralverriegelung ""Keyless-Entry"", Sicherheitsinnenspiegel automatisch abblendbar, Automatische Distanzregelung, SBBR-Leuchte in LED-Technik, Ledersportmultifunktionslenkrad mit Tiptronic, beheizbar, Außenspiegelgehäuse in Aluminium, Variante "" S "", Allradantrieb, Dreip.-Automatikgurte vorn,mit elektr. Höheneinstellung und memory, Sicherheitslenksäule mit elektr.Axial u.Neigungsverstellung, Sitzheizung für Vorder-/u.Hintersitze, getrennt regelbar, Lautsprecher mit Bose-Sound, Telefonvorbereitung für Handy, Komfortsitze vorn, 12 Volt-Steckdose(n), Climatronic mit 2. Verdampfer und 2. Heizung, Mit erweitertem Sicherheitssystem (Pre Crash Basic, Front und Heck), 8 Zyl.Ottomotor 4,0L Aggr. 079.E, Sonnenschutzrollo für Heckscheibe und für Seitenscheiben hinten elektr. betätigt, Scheinwerferreinigungsanlage, Airbag für Fahrer und Beifahrer mit Beifahrer-Airbag-Deaktivierung, Servolenkung (Dynamiklenkung), 8-Zylinder-Ottomotor 4,0/382 KW Biturbo, FSI homogen Grundmotor ist: TV7, Diebstahlalarmanlage, Innenraumüber- wachung,Back-up-Horn und Abschleppschutz, Außenspiegel mit Memoryfunktion automatisch abblendbar, elektrisch anklapp-/einstell-/beheizbar, Frontscheibe Wärmeschutzglas, 8-Gang-Automatikgetriebe für Allrad, Lendenwirbelstütze, elektr. einstellbar in Vordersitzlehnen, Servoschließung Heckklappe, Tagesfahrlichtschaltung -- NAR --, Radio ""HIGH"", Scheiben seitlich und hinten, einbruchhemmend, Reifen 265/40 R20 104Y xl, Schalthebelknopf Sport, Hinterachsgetriebe Torque Vectoring, Kindersitzverankerung für Kindersitzsystem ISO FIX, Zusätzliche Leseleuchten hinten, Assistenz-Paket inklusive Audi pre sense plus, Komfortsitz-Paket vorn, Matrix-Beam, Mit Verkehrszeichenerkennung, Abbiege und Allwetterlicht, Frischluftansaugung und Ionisator, Anschlussgarantie 1 Jahr, max. 90.000 km, Zentrale Bedieneinheit, vorn, Head-Up Display, Assistenz-Paket ""Licht und Sicht"", Reifendruckkontrolle, Durchladeeinrichtung, Nichtraucherausführung, Parklenkassistent, Spurwechselassistent plus Spurhalteassistent (Heading Control Assist), Gepäckspinne, Abgasanlage (Sound-Abgas), '),
(18, 26, 113, 10, 0, 0, 0, 6, 1963, 165000, 23500, 'Benzin', 0, 84, '2/3', 'Weiß', 0, 2, 'keine', '19 Cabrio Chapron', 1, '11/2016', '2015-02-24', 'Die DS 19 läuft seiden weich, der Wagen würde aufwending vor längerer Zeit restauriert. Danach nur mal bei schönem Wetter gefahren. Nicht verbastelt hat noch die rote Hydraulick. Kenner wissen, das der Wagen nur noch selten im Original verfügbar ist, 190SL Mercedes gibt an fast jeder Ecke. Es einiges an Rechnungen als Nachweis der Investitionen.\r\nWas im Frühjahr gemacht wird:\r\n- Reifen\r\n- Druckkugeln\r\n- Lederpflege/ ggf. auch erneuert\r\n \r\nBin ggf. auch zum Tauschen gegen Oldtimer Mercedes mit Wertausgleich bereit. Abwicklung: Banktransfer und oder in Bar.'),
(19, 4, 21, 10, 0, 1, 0, 12, 2010, 700, 3964, 'Benzin', 0, 3, 'null', 'Weiß', 0, 0, 'keine', '', 0, '', '2015-02-24', 'Verkaufe meinen weiß/pinken Roller.\r\n\r\n    45er Papiere, fährt aber etwas schneller\r\n\r\n    paar optische Mängel (Kratzer und eingerostete Schrauben)\r\n    neuer Auspuff \r\n\r\n\r\n\r\n\r\nAlle Angaben ohne Gewähr!\r\nBei Interesse anrufen oder E-Mail schreiben.. ');
